  radio logs were submitted to NODC by Mr. Steven Paul of FleetnNumerical Oceanography
  Center, Monterey CA. The XBT data from thesenstripcharts have been digitized and
  is present in the current NODC datanstorage system in C116 file format.\",\n\t\"owner_org\":
